import { Fragment } from 'react';
import { Outlet } from 'react-router-dom';



import {
  NavigationContainer,
  NavLinks,
  NavLink,
  
} from './navbar.styles';

const NavBar = () => {
  
  return (
    <Fragment>
      <NavigationContainer>
        <NavLinks>
          <NavLink to='/shop'>SHOP</NavLink>

          {currentUser ? (
            <NavLink as='span' onClick={signOutUser}>
              SIGN OUT
            </NavLink>
          ) : (
            <NavLink to='/auth'>SIGN IN</NavLink>
          )}
          <CartIcon />
        </NavLinks>
      </NavigationContainer>
      <Outlet />
    </Fragment>
  );
};

export default NavBar;
